script: |
  super -f text -I q1089.spq | sort > q1089.out

inputs:
  - name: q1089.spq
    data: |
      SELECT DISTINCT + col0, + CAST ( - col2 AS INTEGER ) FROM tab2 (FORMAT parquet) WHERE NOT col2 * + col0 + col2 NOT IN ( 63, col1, - 9 * - + CAST ( NULL AS INTEGER ) * - ( + col0 ) );
  - name: tab2

outputs:
  - name: q1089.out
    data: |
